import React from "react";

const Register2 = () => {  
    return (
      <div className="m-auto w-25 p-3">
        <div className="card rounded-3 bg-body-secondary rounded-5 border border-4 border-success" style={{ backgroundColor: "rgba(255, 255, 255, 0.8)", border: "1px solid #ddd" }}>
          <div className="card-body text-center">
            <h5 className="card-title fs-2">Cadastro Enviado aos nossos Adminsitradores!</h5>
            <p className="card-text fs-4">Os dados foram enviados com sucesso e serão avaliados assim que possível.</p>
            <p className="card-text fs-4">Entraremos em contato em caso de dúvidas ou necessidade de confirmação das informações.</p>
          </div>
        </div>
      </div>
    );
  }

export default Register2;
